{
  "query": "query Post($id: ID = "") {
  post(id: $id, idType: SLUG) {
    excerpt(format: RENDERED)
    content(format: RENDERED)
    featuredImage {
      node {
        altText
        id
        mediaDetails {
          height
          width
        }
        sourceUrl
      }
    }
    author {
      node {
        avatar {
          url
          height
          width
        }
        lastName
        firstName
      }
    }
    date
    modified
    title(format: RENDERED)
    categories {
      nodes {
        name
      }
    }
  }
}",
  "variables": {
    id: $ws$system.params.slug
},
}

{
  "query": "query Posts($search: String = "", $first: Int, $after: String) {
  posts(where: {search: $search}, first: $first, after: $after) {
    pageInfo {
      hasNextPage
      hasPreviousPage
      startCursor
      endCursor
    }
    edges {
      cursor
      node {
        excerpt(format: RENDERED)
        featuredImage {
          node {
            altText
            mediaDetails {
              width
              height
            }
            sourceUrl
          }
        }
        modified
        date
        title(format: RENDERED)
        slug
      }
    }
  }
}",
  "variables": {
  search: $ws$system.search.search,
  first: $ws$dataSource$3fgg1MRgbQr2fsQxXu4_v,
  after: $ws$system.search.after
},
}

{
  "query": "query Page($id: ID = "") {
  page(id: $id, idType: URI) {
    content(format: RENDERED)
    featuredImage {
      node {
        altText
        mediaDetails {
          height
          width
        }
        sourceUrl
      }
    }
    date
    modified
    title(format: RENDERED)
  }
}",
  "variables": {
    id: $ws$system.params.slug
},
}
